import React from 'react';
export default function test({ countries }) {
    return (
        <div  className='custom_select'>
            <select >
                <div>
                {countries.map(({ Country, ISO2 }) => (
                    <option key={ISO2} value={ISO2.toLowerCase()} >
                        {Country}
                    </option>
                ))}

                </div>
            </select>

            <ion-icon name="chevron-down-outline"></ion-icon>

           
        </div>
    );

}
